namespace MultiShip\Tests\Label;


use MultiShip\Tests\BaseTestCase;
use MultiShip\Label\ShipmentLabel;

/**
 * Generated by PHPUnit_SkeletonGenerator 1.2.1 on 2013-11-03 at 10:33:52.
 *
 * @covers MultiShip\Label\ShipmentLabel
 */
class ShipmentLabelTest extends BaseTestCase
{
    /**
     * @var ShipmentLabel
     */
    protected $object;

    protected function setUp()
    {
        $this->object = new ShipmentLabel();

        $this->object->setImageFormat( 'GIF' );
        $this->object->setImageDescription( 'Graphics Interchange Format' );
        $this->object->setGraphicImage( 'base64encodedstring' );
        $this->object->setHtmlImage( 'shorter_base64encodedstring' );
        $this->object->setPdfImage( 'pdf_image_string' );
    }

    /**
     * @covers MultiShip\Label\ShipmentLabel::setImageFormat
     */
    public function testSetImageFormat()
    {
        $this->object->setImageFormat( 'ZPL' );

        $this->assertNotNull( $this->object->getImageFormat() );
        $this->assertEquals( 'ZPL', $this->object->getImageFormat() );
    }

    /**
     * @covers MultiShip\Label\ShipmentLabel::getImageFormat
     */
    public function testGetImageFormat()
    {
        $this->assertNotNull( $this->object->getImageFormat() );
        $this->assertEquals( 'GIF', $this->object->getImageFormat() );
    }

    /**
     * @covers MultiShip\Label\ShipmentLabel::setImageDescription
     */
    public function testSetImageDescription()
    {
        $this->object->setImageDescription( 'ZPL' );

        $this->assertNotNull( $this->object->getImageDescription() );
        $this->assertEquals( 'ZPL', $this->object->getImageDescription() );
    }

    /**
     * @covers MultiShip\Label\ShipmentLabel::getImageDescription
     */
    public function testGetImageDescription()
    {
        $this->assertNotNull( $this->object->getImageDescription() );
        $this->assertEquals( 'Graphics Interchange Format', $this->object->getImageDescription() );
    }

